  background-color: lightgrey;
  font-family: "Montserrat";
  font-style: normal;
  font-weight: 500;
  font-size: 18px;
  color: #ff6060;
  width: 70%;
`;
const RightDescription = styled.div`
  background-color: lightsalmon;
  font-family: "Montserrat";
  font-style: normal;
  font-weight: 500;
  font-size: 18px;
  color: #ff6060;
  width: 30%;
  display: flex;
  justify-content: flex-end;
  p {
    
    display: flex;
    justify-content: flex-end;
    height: 50px;
    width: 150px;
  }
`;

const TagContainer = styled.div`
  display: flex;
  width: 50%;
`;
export default function Title() {
  return (
    <Description>
      <LeftDescription>
        <h1>Cozy loft on the Canal Saint-Martin</h1>
        <p>Paris, Ile-de-France</p>
        <TagContainer>
          <Tag />
          <Tag />
          <Tag />
        </TagContainer>
      </LeftDescription>
      <RightDescription>
        <p>
          Nom <br></br> p√©lo
        </p>
        <UserPic />
      </RightDescription>
    </Description>
  );
}
